'field_5caf3f2aeff5d'),(179,57,'valores','Ética e transparência;\r\n\r\nAtendimentos e serviços voltados;\r\n\r\nCompromisso com a qualidade;\r\n\r\nHonestidade e igualdade;\r\n\r\nResponsabilidade Social;\r\n\r\nRespeito ao Meio Ambiente'),(180,57,'_valores','field_5caf3f3deff5f'),(181,11,'conteudo','<p style=\"text-align: center;\">A Bigatello Transportes empresa fundada em 2002 é especializada em <strong>transportes especiais</strong>,\r\nEntre seus clientes estão empresas importantes na área da Construção Civil, Mecânica Pesada e de Mecanização de solos.\r\nTransportes de carga excedente com carretas tipo prancha, extensiva e lagartixas.</p>\r\n<p style=\"text-align: center;\">Possuímos uma vasta experiência em cargas dimensionadas, onde utilizamos nossa variedade de equipamentos para acomodação e segurança no transportes.\r\nTrabalhamos com carretas pranchas retas e rebaixadas, carretas extensivas, carretas convencionais e carretas prancha com suspensão pneumática adaptadas com looks para 20 e 40 pés.</p>\r\n<p style=\"text-align: center;\">Desenvolve e presta serviços de transportes especiais em todo o território nacional.\r\nPlanejamento e segurança garantem aos nossos clientes a tranquilidade necessária.</p>'),(182,11,'_conteudo','field_5caf40613982f'),(183,59,'texto','<span style=\"font-size: 36px;\">Lorem ipsum dolor sit amet con tetur adipiscing elitfusce nisi <span style=\"color: #f2e600;\">sem, pulvinar</span></span>'),(184,59,'_texto','field_5caf3df7eff57'),(185,59,'imagem','55'),(186,59,'_imagem','field_5caf3e07eff59'),(187,59,'missao','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer sit amet porta ligula. Integer nulla neque, dignissim ac lectus non, euismod scelerisque nisl. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Suspendisse id molestie nisl. Quisque sed orci volutpat, dignissim lectus vitae, elementum turpis. Ut at venenatis magna. Sed ege'),(188,59,'_missao','field_5caf3e21eff5b'),(1