i>\r\n</ul>'),(782,213,'_valores','field_5caf3f3deff5f'),(783,213,'conteudo','<p style=\"text-align: center;\">A Bigatello Transportes empresa fundada em 2002 é especializada em <strong>transportes especiais</strong>,\r\nEntre seus clientes estão empresas importantes na área da Construção Civil, Mecânica Pesada e de Mecanização de solos.\r\nTransportes de carga excedente com carretas tipo prancha, extensiva e lagartixas.</p>\r\n<p style=\"text-align: center;\">Possuímos uma vasta experiência em cargas dimensionadas, onde utilizamos nossa variedade de equipamentos para acomodação e segurança no transportes.\r\nTrabalhamos com carretas pranchas retas e rebaixadas, carretas extensivas, carretas convencionais e carretas prancha com suspensão pneumática adaptadas com looks para 20 e 40 pés.</p>\r\n<p style=\"text-align: center;\">Desenvolve e presta serviços de transportes especiais em todo o território nacional.\r\nPlanejamento e segurança garantem aos nossos clientes a tranquilidade necessária.</p>'),(784,213,'_conteudo','field_5caf40613982f'),(785,214,'texto','Conheça nossa frota'),(786,214,'_texto','field_5caf44cbb6370'),(787,214,'conteudo','<ul>\r\n 	<li>Cavalos 4x2 / 6x2 / 6x4</li>\r\n 	<li>Truck Plataforma</li>\r\n 	<li>Carretas Pranchas 02 eixos / 03 eixos / 04 eixos / 05 eixos</li>\r\n 	<li>Carretas Prancha Pneumáticas 02 eixos / 03 eixos / 04 eixos</li>\r\n 	<li>Carretas Pranchas com Look 02 eixos / 03 eixos / 04 eixos</li>\r\n 	<li>Carretas Lagartixas 02 eixos / 03 eixos /04 eixos</li>\r\n 	<li>Carretas Extensivas até 30 metros</li>\r\n</ul>'),(788,214,'_conteudo','field_5caf44cbb63d0'),(789,214,'imagem','94'),(790,214,'_imagem','field_5caf44cbb648a'),(791,214,'galeria','a:1:{i:0;s:3:\"187\";}'),(792,214,'_galeria','field_5caf44cbb66b8'),(793,215,'texto','Conheça nossa frota'),(794,215,'_texto','field_5caf44cbb6370'),(795,215,'conteudo','<ul>\r\n 	<li>Cavalos 4x2 / 6x2 / 6x4</li>\r\n 	<li>Truck Plataforma</li>\r\n 	<li>Carretas Pranchas 02 eixos / 03 eixos / 0